import React from 'react';
import banner from "./assets/banner.jpg";
import "./styles/Home.css"
import Product from "./Product"
import headset_image from "./assets/headset.jpg"


function Home() {
    return (
        <div className="home">
            <img className="banner-image" src={banner} alt="banner"></img>
            <Product id="12831" title="Logitech G PRO X Wireless Lightspeed Gaming Headset with Blue VO!CE Mic Filter Tech, 50 mm PRO-G Drivers, and DTS Headphone:X 2.0 Surround Sound
"
                price="199.99" rating="5" image={headset_image} />
        </div>

    )
}
export default Home;
